import React, { Component } from "react";
import "./App.css";
import Welcome from "./pages/welcome";
import SignUp from "./pages/signUp";
import NotFoundPage from "./pages/404";

//Import all needed Component for this tutorial
import {
  BrowserRouter as Router,
  Route,
  Switch,
  Link,
  Redirect,
} from "react-router-dom";

// Import Auth0Context instead of useAuth0
import { Auth0Context } from "./react-auth0-spa";
import Soundcloud from "soundcloud.ts";

class App extends Component {
  componentDidMount() {
    document.body.style.background = "#252525";
    async function useAPI() {
      const soundcloud = new Soundcloud(
        process.env.SOUNDCLOUD_CLIENT_ID,
        process.env.SOUNDCLOUD_OAUTH_TOKEN
      );

      /*You can get tracks by URL or ID (which can only be gotten from the API)*/
      const track = await soundcloud.tracks.get(
        "https://soundcloud.com/imtenpi/snowflake"
      );
    }

    console.log("Track Id: ", useApi().track.id);
  }

  static contextType = Auth0Context;

  render() {
    const { loading } = this.context;

    if (loading) {
      return <div>Loading...</div>;
    }

    return (
      <Router>
        {/*All our Routes goes here!*/}
        <Switch>
          <Route exact path="/Welcome" component={Welcome} />
          <Route exact path="/signUp" component={SignUp} />
          <Route exact path="/404" component={NotFoundPage} />
          <Redirect to="/404" />
        </Switch>
      </Router>
    );
  }
}

export default App;
